(1, 1, '/images/public_download/bengaliimages/ekattor_er_chithi.jpg', ' একাত্তরের চিঠি', 'রণাঙ্গনে মুক্তিযোদ্ধারা ', 'প্রথমা প্রকাশন', ' মুক্তিযুদ্ধের ইতিহাস: ডায়েরি, চিঠি ও স্মৃতিচারণ ', 'ekattor_er_chithi', 10, 10.00, NULL, NULL, NULL),
(2, 1, '/images/public_download/bengaliimages/aguner_poroshmoni.gif', ' আগুনের পরশমণি', 'হাতেখড়ি', 'হুমায়ূন আহমেদ ', 'মুক্তিযুদ্ধভিত্তিক ও রাজনৈতিক উপন্যাস', 'aguner_poroshmoni', 20, 25.00, NULL, NULL, NULL),
(3, 8, '/images/public_download/bengaliimages/deyal.jpg', 'দেয়াল', 'অন্যপ্রকাশ', 'হুমায়ূন আহমেদ', 'ভাদ্র মাসের সন্ধা। আকাশে মেঘ আছে। লালচে রঙের মেঘ। যে মেঘে বৃষ্টি হয় না, তবে দেকায় অপূর্ব। এই গাঢ় লাল, এই হালকা হলুদ, আবার চোখের নিমিষে লালের সঙ্গে খয়েরি মিশে সম্পূর্ণ অন্য রঙ। রঙের খেলা যিনি খেলছেন মনে হয় তিনি সিদ্ধান্তহীনতায় ভুগছেন।', 'deyal', 15, 30.00, NULL, NULL, NULL),
(4, 8, '/images/public_download/bengaliimages/d_tin_dram.gif', ' দ্য টিন ড্রাম', 'অন্যধারা', 'গুন্টার গ্রাস , প্রমিত হোসেন', 'অনুবাদ: উপন্যাস', 'd_tin_dram', 10, 25.00, NULL, NULL, NULL),
(5, 8, '/images/public_download/bengaliimages/puruno_sei_diner_kotha.gif', ' পুরানো সেই দিনের কথা', 'মিত্র ও ঘোষ পাবলিশার্স প্রাঃ লিঃ (ভারত)', 'শ্রী প্রমথনাথ বিশী', 'জীবনী ও স্মৃতিচারণ: বিবিধ', 'puruno_sei_diner_kotha', 10, 50.00, NULL, NULL, NULL),
(6, 8, '/images/public_download/bengaliimages/agun_pakhir_rohossho.jpg', ' আগুন পাখির রহস্য', 'আনন্দ পাবলিশার্স (ভারত)', 'সুনীল গঙ্গোপাধ্যায়', 'পশ্চিমবঙ্গের রহস্য, গোয়েন্দা ও ভৌতিক', 'agun_pakhir_rohossho', 10, 40.00, NULL, NULL, NULL),
(7, 8, '/images/public_download/bengaliimages/osomapto_attojiboni.jpg', ' অসমাপ্ত আত্মজীবনী', 'দি ইউনিভার্সিটি প্রেস লিমিটেড(ইউ পি এল)', 'শেখ মুজিবুর রহমান', 'শেখ মুজিবুর রহমানের লেখা চারটি খাতা ২০০৪ সালে আকস্মিকভাবে তাঁর কন্যা শেখ হাসিনার হস্তগত হয়। খাতাগুলি অতি পুরানো, পাতাগুলি জীর্ণপ্রায় এবং লেখা প্রায়শ অস্পষ্ট। মূল্যবান সেই খাতাগুলি পাঠ করে জানা গেল এটি বঙ্গবন্ধুর অসমাপ্ত আত্মজীবনী, যা তিনি ১৯৬৭ সালের মাঝামাঝি সময়ে ঢাকা সেন্ট্রাল জেলে অন্তরীণ অবস্থায় লেখা শুরু করেছিলেন, কিন্তু শেষ করতে পারেননি। জেল-জুলুম, নিগ্রহ-নিপীড়ন যাঁকে সদা তাড়া করে ফিরেছে, রাজনৈতিক কর্মকাণ্ডে উৎসর্গীকৃত-প্রাণ, সদাব্যস্ত বঙ্গবন্ধু যে আত্মজীবনী লেখায় হাত দিয়েছিলেন এবং কিছুটা লিখেছেনও, এই বইটি তার সাক্ষর বহন করছে। বইটিতে আত্মজীবনী লেখার প্রেক্ষাপট, লেখকের বংশ পরিচয়, জন্ম, শৈশব, স্কুল ও কলেজের শিক্ষাজীবনের পাশাপাশি সামাজিক ও রাজনৈতিক কর্মকাণ্ড, দুর্ভিক্ষ, বিহার ও কলকাতার দাঙ্গা, দেশভাগ, কলকাতাকেন্দ্রিক প্রাদেশিক মুসলিম ছাত্রলীগ ও মুসলিম লীগের রাজনীতি, দেশ বিভাগের পরবর্তী সময় থেকে ১৯৫৪ সাল অবধি পূর্ব বাংলার রাজনীতি, কেন্দ্রীয় ও প্রাদেশিক মুসলিম লীগ সরকারের অপশাসন, ভাষা আন্দোলন, ছাত্রলীগ ও আওয়ামী লীগ প্রতিষ্ঠা, যুক্তফ্রন্ট গঠন ও নির্বাচনে বিজয়ী হয়ে সরকার গঠন, আদমজীর দাঙ্গা, পাকিস্তান কেন্দ্রীয় সরকারের বৈষম্যমূলক শাসন ও প্রাসাদ ষড়যন্ত্রের বিস্তৃত বিবরণ এবং এসব বিষয়ে লেখকের প্রত্যক্ষ অভিজ্ঞতার বর্ণনা রয়েছে। আছে লেখকের কারাজীবন, পিতা-মাতা, সন্তান-সন্ততি ও সর্বোপরি সর্বংসহা সহধর্মিণীর কথা, যিনি তাঁর রাজনৈতিক জীবনে সহায়ক শক্তি হিসেবে সকল দুঃসময়ে অবিচল পাশে ছিলেন। একইসঙ্গে লেখকের চীন, ভারত ও পশ্চিম পাকিস্তান ভ্রমণের বর্ণনাও বইটিকে বিশেষ মাত্রা দিয়েছে।', 'osomapto_attojiboni', 100, 75.00, NULL, NULL, NULL),
(8, 8, '/images/public_download/bengaliimages/kaler_sonkhipto_itihash.GIF', ' কালের সংক্ষিপ্ত ইতিহাস', 'দি স্কাই পাবলিশার্স', 'স্টিফেন হকিং ,  অধ্যাপক সাখাওয়াত হোসেন', 'সূচিপত্র\r\n\r\n* মহাবিশ্ব সম্পর্কে আমাদের চিত্র\r\n* স্থান এবং কাল\r\n* প্রসারমান মহাবিশ্ব\r\n* অনিশ্চয়তাবাদ\r\n* মৌলকণা এবং প্রাকৃতিক বল\r\n* কৃষ্ণগহ্বর\r\n* কৃষ্ণগহ্বর অত কালো নয়\r\n* মহাবিশ্বের উৎপত্তি ও পরিণতি\r\n* সময়ের তীর\r\n* পদার্থবিদ্যাকে ঐক্যবদ্ধ করা\r\n* উপসংহার', 'kaler_sonkhipto_itihash', 10, 20.00, NULL, NULL, NULL),
(9, 1, '/images/public_download/bengaliimages/ekattor_er_diary.jpg', ' একাত্তরের ডায়েরী', 'হাওলাদার প্রকাশনী', 'সুফিয়া কামাল', '১৯১১ সালের ২০ জুন বরিশালের শায়েস্তাবাদের মাতামহের বাড়িতে সুফিয়া কামালের জন্ম। মা সাবেরা বানু এবং বাবা সৈয়দ আব্দুল বারি। পারিবারিক পরিমণ্ডলে সাহিত্য-পত্রিকা ও গল্প পড়তে-পড়তেই সাহিত্যচর্চার অনুপ্রাণিত হন।মাত্র ১৪ বছর বয়সে বরিশাল থেকে ‘তরুণ’ পত্রিকায় ‘সৈনিক বধূ’ গল্পটি তাঁর প্রথম প্রকাশিত রচনা। লেখালেখির কাজ সুফিয়াকে লুকিয়ে করতে হয়েছে-বিশেষ করে বাংলা ভাষার চর্চা ছিলো না। সীমাবদ্ধ ছিল আরবি, ফারসি, উর্দুতে। মায়ের ঐকান্তিক সহযোগিতায় সুফিয়া বাংলা বলতে, পড়তে ও লিখতে শেখেন। লুকিয়ে লুকিয়ে কবিতা রচনা করতে-করতেই সওগাতে প্রকাশিত হল তার প্রথম কবিতা ‘বাসন্তী’ যা সাথে-সাথেই সবার দৃষ্টি আকর্ষণ করে। প্রথম গ্রন্থ রচয়িতা হিসেবে আত্মপ্রকাশ করেন ‘সাঁঝের মায়া’ কাব্যসমগ্র প্রকাশের মাঝে। কবি কাজী নজরুল ইসলাম তাঁকে দীর্ঘ চিঠি লিখে কাব্যচর্চায় উৎসাহিত করেন। প্রকৃতপক্ষে ‘সাঁঝের মায়া’ গ্রন্থের ভূমিকাটি তাঁরই লেখা।বিশ্বকবি রবীন্দ্রনাথ তাঁর কবিতা পড়ে তাঁকে আর্শীবাণী পাঠিয়েছিলেন এই বলে, ‘তোমার কবিত্ব আমাকে বিস্মিত করে। বাংলা সাহিত্যে তোমার স্থান উচ্চে এবং ধ্রুত তোমার প্রতিষ্ঠা আমার আশির্বাদ গ্রহণ করো।’ (সেলিম জাহাঙ্গীর, সুফিয়া কামাল, নারী উদ্যোগ কেন্দ্র, ঢাকা ১৯৯৩ পৃ-৬৪) সওগাত সম্পাদক মোহাম্মদ নাসিরুদ্দীন তাঁর সাহিত্য-জীবনে উৎসাহের বিরাট উৎস হিসেবে কাজ করেছেন।', 'ekattor_er_diary', 10, 60.00, NULL, NULL, NULL),
