(11, 5, '/images/public_download/bengaliimages/origin.jpg', 'অরিজিন', 'অন্যধারা', 'ড্যান ব্রাউন , রাব্বি উস সানী , অমিত রহমান', 'অনুবাদ রহস্য, ভৌতিক, থ্রিলার ও অ্যাডভেঞ্চার', 'origin', 10, 25.00, NULL, NULL, NULL),
